It was our weekly poker night last week when the baby sitter stopped by. She got the days confused and thought we needed her. At least that is what she claimed. The real reason she came by was quite apparent when she suddenly stripped off her clothes and begged us to gang bang her. I can't believe she took all of us at once. Needless to say we can't wait until next poker night!
